//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_LANDING_TARGET_TYPE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e LANDING_TARGET_TYPE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := LANDING_TARGET_TYPE_LIGHT_BEACON.MarshalText()
		require.NoError(t, err)

		var dec LANDING_TARGET_TYPE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, LANDING_TARGET_TYPE_LIGHT_BEACON, dec)
	})
}
